import React, {useEffect, useState} from "react";
import { AllRequestsMap } from "../components/allRequests";


export function AllRequests(){
    const [data, setData] = useState()
    useEffect(() => {
        fetch(`http://127.0.0.1:8000/zayavkipolz/`,{method : "GET"})
            .then((res) => res.json())
            .then((data) => {
                    setData(data)
                }
            );
    }, [setData])
    console.log(data)
    return(
        <div className='profile-div'>
            <div className='search'>
                <input type='text' className="searching-bar" placeholder='Введите номер заявки...'/>
            </div>
            {data && <div className="profile-requests">
                {data.map((data) => <AllRequestsMap Props={data} key={data.id}/>)}
            </div>}
        </div>
    )
}
